    false,nt"url": null,nt"notes": "The gravity station data (195 records)
    were compiled by Barbara Eckstein. This data base was received in January 1987.
    Principal gravity parameters include Free-Air Anomalies and Simple Bouguer Anomalies
    (no terrain correction applied). The observed gravity values are referenced to the
    International Gravity Standardization Net 1971 (IGSN 71). The gravity anomaly computation
    uses the Geodetic Reference System 1967 (GRS 67) theoretical gravity formula. The
    data are randomly distributed within the Rhinelander area of northern Wisconsin.",nt"license_title":
